// src/components/Services/Services.js
import React from 'react';
import styles from './Services.module.css';

function Services() {
  return (
    <section className={styles.services}>
      <div className={styles.servicesContent}>
        
        {/* Service Item 1 */}
        <div className={styles.srv}>
          <i className={`${styles.icon} fas fa-chart-line`}></i>
          <div className={styles.text}>
            <h3 className={styles.textTitle}>Service One</h3>
            <p className={styles.textDescription}>Details about service one.</p>
          </div>
        </div>

        {/* Service Item 2 */}
        <div className={styles.srv}>
          <i className={`${styles.icon} fas fa-lightbulb`}></i>
          <div className={styles.text}>
            <h3 className={styles.textTitle}>Service Two</h3>
            <p className={styles.textDescription}>Details about service two.</p>
          </div>
        </div>

        {/* Service Item 3 */}
        <div className={styles.srv}>
          <i className={`${styles.icon} fas fa-heart`}></i>
          <div className={styles.text}>
            <h3 className={styles.textTitle}>Service Three</h3>
            <p className={styles.textDescription}>Details about service three.</p>
          </div>
        </div>
      </div>

      {/* Optional Image Column */}
      <div className={styles.imageContainer}>
        <div className={styles.imageColumn}>
          <img src="/images/services.jpg" alt="Service related" className={styles.image} />
        </div>
      </div>
    </section>
  );
}

export default Services;
